import React, { useState } from "react";
import classes from "./ViewStats.module.css";
import "./MuiTabs.css";
import TriviaHeader from "../../UI/Header/TriviaHeader";
import { Box, Tab, Tabs, Typography } from "@mui/material";

function ViewStats(props) {
  const [token, setToken] = useState(
    JSON.parse(sessionStorage.getItem("token"))
  );
  const [userData, setUserData] = useState(
    JSON.parse(localStorage.getItem("userData"))
  );
  const [currentTabIndex, setCurrentTabIndex] = useState(0);
  const [previousGameGrade, setPreviousGameGrade] = useState("");

  const previousGameWinPercent =
    (userData.previousGame.correctAnswers / userData.previousGame.questions) *
    100;

  if (previousGameWinPercent <= 100 && previousGameWinPercent > 70) {
    setPreviousGameGrade("A");
  } else if (previousGameWinPercent < 70 && previousGameWinPercent > 70) {
  }

  const handleTabChange = (e, tabIndex) => {
    console.log(tabIndex);
    setCurrentTabIndex(tabIndex);
  };

  return (
    <div className={classes.container}>
      <div>
        <TriviaHeader token={token} />
      </div>
      <div>
        <Tabs value={currentTabIndex} onChange={handleTabChange} centered>
          <Tab label="Cumulative Result" />
          <Tab label="Previous Result" />
        </Tabs>
      </div>
      <div className={classes.resultContainer}>
        {currentTabIndex === 0 && (
          <div className={classes.results}>
            <div className={classes.individualData}>
              <h3>Total Quizzes attended :</h3>
              <h4>{userData.totalGames}</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Total Wins :</h3>
              <h4>{userData.totalWins}</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Win Rate (%) :</h3>
              <h4>{userData.winPercent}%</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Grade :</h3>
              <div className={classes.grade}>
                <h4>{userData.totalGrade}</h4>
              </div>
            </div>
          </div>
        )}
        {currentTabIndex === 1 && (
          <div className={classes.results}>
            <div className={classes.individualData}>
              <h3>Total Questions :</h3>
              <h4>{userData.previousGame.questions}</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Category :</h3>
              <h4>{userData.previousGame.category}</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Difficulty :</h3>
              <h4>{userData.previousGame.difficulty}</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Correct Answers :</h3>
              <h4>{userData.previousGame.correctAnswers}</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Win Rate (%) :</h3>
              <h4>{previousGameWinPercent}%</h4>
            </div>
            <div className={classes.individualData}>
              <h3>Grade :</h3>
              <div className={classes.grade}>
                <h4>{previousGameGrade}</h4>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default ViewStats;
